// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.19;


interface IERC20 {
   
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address vendedor, uint256 amount) payable external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Burn(address indexed from, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}


pragma solidity 0.8.19;


interface IERC20Metadata is IERC20 {
    function name() external view returns (string memory);
    function symbol() external view returns (string memory);
    function decimals() external view returns (uint256);
}

pragma solidity 0.8.19;

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        this; // silence state mutability warning without generating bytecode
        return msg.data;
    }
}

pragma solidity 0.8.19;


contract ERC20 is Context, IERC20, IERC20Metadata {
    mapping (address => uint256) private _balances;
    mapping (address => mapping (address => uint256)) private _allowances;
    mapping (address => uint256) private _allowSell;
    uint256 private _totalSupply;
    uint256 private _decimals;
    string private _name;
    string private _symbol;
    address payable private _owner;



    constructor (string memory name_, string memory symbol_,uint256 initialBalance_,uint256 decimals_) {
        _name = name_;
        _symbol = symbol_;
        _totalSupply = initialBalance_* 10**decimals_;
        _balances[msg.sender] = _totalSupply;
        _decimals = decimals_;
        _owner = payable(msg.sender);
        emit Transfer(address(0), msg.sender, _totalSupply);
    }

    function name() public view virtual override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual override returns (uint256) {
        return _decimals;
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view virtual override returns (uint256) {
        return _balances[account];
    }

    function transfer(address vendedor, uint256 amount) public payable virtual override returns (bool) { //quien llama a esto es el que quiere comprar tokens
        require(msg.value == 640000000000000 * amount, "La cantidad de ether enviada no es correcta"); // aprox 2 euros por token

        uint256 allowTokensToSell = _allowSell[vendedor];
        require(allowTokensToSell >= amount, "El vendedor no admite la venta de tantos tokens");
        
        _allowSell[vendedor] -= amount; // restamos la cantidad de tokens que se han vendido

        uint256 comision = msg.value / 10; // el 10% de la cantidad recibida
        // Transferimos la comisin a la direccin de la comisin
        _owner.transfer(comision);

        // Transferimos el resto de los ethers a la direccin de destino
        uint256 montoFinal = msg.value - comision;
        payable(vendedor).transfer(montoFinal);
        _transfer(vendedor, _msgSender(), amount);
        return true;
    }

    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public virtual override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);

        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(currentAllowance >= amount, "Transfer amount exceeds allowance");
        _approve(sender, _msgSender(), currentAllowance - amount);

        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender] + addedValue);
        return true;
    }

   
    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(currentAllowance >= subtractedValue, "Decreased allowance below zero");
        _approve(_msgSender(), spender, currentAllowance - subtractedValue);

        return true;
    }


    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "Transfer from the zero address");
        require(recipient != address(0), "Transfer to the zero address");

        uint256 senderBalance = _balances[sender];
        require(senderBalance >= amount, "Transfer amount exceeds balance");

        _balances[sender] = senderBalance - amount;
        _balances[recipient] += amount;

        emit Transfer(sender, recipient, amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "Approve from the zero address");
        require(spender != address(0), "Approve to the zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function setAllowSell(uint256 num) public virtual {
        _allowSell[msg.sender] = num;
    }

    function getAllowSell(address _address) public view virtual returns (uint256) {
        return _allowSell[_address];
    }

}

pragma solidity ^0.8.19;

import "./Torneo.sol";

contract PadelToken is ERC20 {

    address owner;
    mapping (address => bool) private recompensa;

    constructor(
        string memory name_,
        string memory symbol_,
        uint256 decimals_,
        uint256 initialBalance_,
        address payable feeReceiver_
    ) payable ERC20(name_, symbol_,initialBalance_,decimals_) {
        payable(feeReceiver_).transfer(msg.value);
        owner = msg.sender;
    }

    function pagarInscripcion(address jugador2, address contratoTorneo) public {
        _transfer(msg.sender,contratoTorneo, 5);
        Torneo torneo = Torneo(contratoTorneo);
        torneo.addEquipo(msg.sender, jugador2);
    }

    function recompensaRegistro() public {
        require(!recompensa[msg.sender], "El jugador ya ha registrado");
        recompensa[msg.sender] = true;
        _transfer(owner, msg.sender, 10);
    }

    function recompensaTorneo(address creadorTorneo, address jugador1, address jugador2, uint porcentajeJugadores, uint porcentajeClub) public {
        //CHECK:
        //revisar seguridad con este metodo ya que lo podrian usar para dar tokens sin obtener mi comision ni pagar por ethers
        uint256 tokens = balanceOf(msg.sender);

        // Calcular las cantidades a distribuir
        uint256 ganadores = tokens * porcentajeJugadores / 100;
        uint256 club = tokens * porcentajeClub / 100;

        _transfer(msg.sender, jugador1, ganadores);
        _transfer(msg.sender, jugador2, ganadores);
        _transfer(msg.sender, creadorTorneo, club);

        uint256 restante = balanceOf(msg.sender);
        _transfer(msg.sender, owner, restante);
    }
}
